import React from "react";
import PropTypes from "prop-types";

function Navbar(props){

    return (
        <div>
            <h3>{props.title}</h3>
            <ul>
                <li>
                    <Link to = "/">Home</Link>
                </li>
                <li>Add User</li>
            </ul>
        </div>
    )
}
Navbar.propTypes = {
    title : PropTypes.string.isRequired
}
Navbar.defaultProps = {
    title : "Default App"
}
export default Navbar;
